import styled from 'styled-components'
import React from 'react'
import {ArrowLeftOutlined, ArrowRightOutlined } from '@mui/icons-material';

const Conatiner = styled.div`
width: 100%;
height: 100vh;
display: flex;
`

const Arrow = styled.div`
width: 50px;
height: 50px;
background-color: #fff7f7;
border-radius: 50%;
`

export const Slider = () => {
  return (
    <Container>
      <Arrow>
      <ArrowRightOutlined/>
      </Arrow>
      <Arrow>
      <ArrowRightOutlined/>
      </Arrow>
    </Container>
  )
}
